import {  Router, Route, Routes } from "react-router-dom";
import HomePage from "./pages/Home";
import ProductsPage from "./pages/Products";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/products" element={<ProductsPage />} />
      </Routes>
    </Router>
  );
}

export default App;
